    false,nt"url": null,nt"notes": "This dataset includes information for projects
    that appear on the City of Austinu2019s Capital Improvement Visualization Information
    and Communication (CIVIC) Map Viewer, www.austintexas.gov/GIS/CIVIC/.  These projects,
    also known as Capital Improvements Program (CIP) projects, implement the construction,
    replacement, or renovation of city assets that are useful to the community. Data
    is currently available for most CIP projects funded in full or in part by voter-approved
    bond programs from 2013, 2012, 2010, 2006, 2000, and 1998.   The dataset below is
    subject to change at any time, and does not represent a comprehensive list of capital
    improvement projects. For more information about the City of Austinu2019s Capital
    Improvement Program, please visit www.austintexas.gov/department/civic. The City
    of Austin has produced CIVIC, a web application to search Capital Improvement Projects,
    for informational purposes only. The data and information available at this web
    site is provided "As is", and "As Available" and without any warranties of any
    kind either express or implied. The City makes no warranty regarding the accuracy
    or completeness of this site and the information provided. By accessing or using
    CIVIC, you agree to these terms of use. The City of Austin may change the terms
    of use at any time at its sole discretion and without notice.u201d",nt"license_title":
